import React from "react";

import city from "../../data/city.json";

const City = () => {
  return (
    <div className="container">
      {city.map((item) => {
        <div>
          {item.image}
          {item.name}
          {item.subText}
        </div>;
      })}
    </div>
  );
};
export default City;
